    // declare a module
    var simpleAppModule = angular.module('simpleApp', []);

    // configure the module.
    // in this example we will create a greeting filter
    simpleAppModule.filter('greet', function() {
    return function(name) {
    return 'Hello, ' + name + '!';
    };
